export default function Card({
   id,
   name,
   status,
   species,
   gender,
   origin,
   image,
   onClose
}) {
   return (
      <div key={id}>
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <h2></h2>
         <h2></h2>
         <h2></h2>
         <h2></h2>
         <img src={image} alt={name} />
      </div>
   );
}
